      SELECT ALL * FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT - col1 NOT IN ( col0 * - col2, col1, col2, + 10, + + col1, - CAST ( + 74 AS INTEGER ) + - + col2 * - + col0 );
  - name: tab2

outputs:
  - name: q5704.out
    data: |
